import React, { useEffect, useState } from "react";
import { Card } from "react-bootstrap";
import companyAPI from "../http/companyAPI";

const ObjectCard = ({ companyId, identifiers }) => {
  const [objectCards, setObjectCards] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await companyAPI.getObjCards(companyId, identifiers);
        setObjectCards(response);
      } catch (error) {
        console.log("Ошибка при получении ыкарточек объектов:", error);
      }
    };

    fetchData();
  }, [companyId, identifiers]);

  return (
    <div>
      {objectCards.map((objectCard, index) => (
        <Card key={index} border="secondary" style={{ margin: 10 }}>
          <Card.Body>
            <Card.Title>Карточка объекта {index + 1}</Card.Title>
            <Card.Text>
              <strong>Реестровый номер:</strong> {objectCard.registry_number || "Нет записи"} <br />
              <strong>Наименование:</strong> {objectCard.name || "Нет записи"} <br />
              {/* Дополнительные поля карточки объекта */}
            </Card.Text>
          </Card.Body>
        </Card>
      ))}
    </div>
  );
};

export default ObjectCard;
